member.summary:
目的：检查需求接口.项目是否存在
前置条件： 并且项目编号不为空
详细描述
若[来源单据类型] != null {
调用项目表的findbycode方法,传入项目编号、PR.[当前组织],取得项目实体
如果项目实体为空,抛出实体不存在，提示项目不存在 }

查找对应物料
根据“组织间营业行为关系” 查找
[营业行为关系] = ××－采购 and 
[来源组织] = 需求组织 and 
[目的组织] = 当前组织 and
[来源料号] = 需求组织物料的[目的料号];
若查找结果不为空
将取得的物料（目的料号）赋给需求接口表[物料]属性;
否则
抛出无对应的采购物料异常(NoCorrespondingItemException(需求组织物料));

查找可转为下游单据的数据        
详细说明
过滤条件为key-value pair，其中key为属性名称，如物料；value为值。目前只支持各key-value间为与的关系
1：遍历Map，取各Map.Entry，
拼装条件：String condition = “×× = ×× and ×× = ×× … ”;
2：IF “采购业务员” != null
condition = “物料.默认采购员 = ” + 当前采购业务员 + 
“and 是否处理 = false and ” + “ ( “+ condition + “)”;
   Else
condition = “是否处理 = false and ” + “ ( “+ condition + “)”;
3：IF “组织” != null
condition = condition + “and 当前组织 ”= 组织
返回根据此条件查询得到的集合;

